import React from 'react';
import Paper from "@material-ui/core/Paper";


export default function Question(props) {

    const q = props.getquestionid(2);
    console.log(props.uri);
    return(
        <Paper>
            <h1>Question Details</h1>
            <p>{q.title}</p>
        </Paper>
    )
}
